import React, { useState } from "react";
import styled from "styled-components";

const PageContainer = styled.div`
    display: flex;
    min-height: 100vh;
    width: 100vw;
    background: linear-gradient(135deg, #667eea, #764ba2);
    padding: 20px;
    box-sizing: border-box;
    position: relative;
`;

const Sidebar = styled.div`
    width: 25%;
    background: #fff;
    border-radius: 10px;
    box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
    padding: 20px;
    margin-right: 20px;
    box-sizing: border-box;
    position: relative; /* Needed for dropdown positioning */
`;

const Content = styled.div`
    flex: 1;
    background: #f7f7f7;
    border-radius: 10px;
    box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
    padding: 20px;
    box-sizing: border-box;
`;

const Section = styled.div`
    margin-bottom: 20px;
`;

const Title = styled.h2`
    color: #333;
    font-family: 'Montserrat', sans-serif;
    margin-bottom: 15px;
    font-size: 22px;
`;

const Button = styled.button`
    background: #667eea;
    border: none;
    border-radius: 50px;
    color: white;
    padding: 10px 20px;
    cursor: pointer;
    font-size: 16px;
    font-weight: bold;
    transition: background 0.3s ease;

    &:hover {
        background: #5a67d8;
    }
`;

const Input = styled.input`
    width: 100%;
    padding: 10px 15px;
    margin: 8px 0;
    border: 1px solid #ccc;
    border-radius: 10px;
    box-sizing: border-box;
`;

const ProfileSection = styled.div`
    position: absolute;
    top: 20px;
    left: 20px;
    background: #000;
    color: #fff;
    border-radius: 10px;
    display: flex;
    align-items: center;
    padding: 10px;
    box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
    z-index: 10;
`;

const ProfileImage = styled.img`
    width: 50px;
    height: 50px;
    border-radius: 50%;
    border: 2px solid #fff;
    margin-right: 10px;
`;

const ProfileDetails = styled.div`
    display: flex;
    flex-direction: column;
`;

const Name = styled.div`
    font-weight: bold;
`;

const Email = styled.div`
    font-size: 14px;
`;

const Dropdown = styled.div`
    position: absolute;
    background: #fff;
    border-radius: 5px;
    box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
    width: 100%;
    top: 100%; /* Position below the parent element */
    left: 0;
    display: ${props => (props.isOpen ? 'block' : 'none')};
    z-index: 5;
`;

const DropdownItem = styled.div`
    padding: 10px;
    border-bottom: 1px solid #ddd;
    cursor: pointer;
    
    &:last-child {
        border-bottom: none;
    }

    &:hover {
        background: #f7f7f7;
    }
`;

const PreviousSubmissionsButton = styled.div`
    cursor: pointer;
    font-size: 16px;
    font-weight: bold;
    color: #333;
    position: relative;
`;

const submissions = [
    { title: 'APK Submission 1', details: 'Details about submission 1...' },
    { title: 'APK Submission 2', details: 'Details about submission 2...' },
    { title: 'APK Submission 3', details: 'Details about submission 3...' },
];

function UploadPage() {
    const [isDropdownOpen, setDropdownOpen] = useState(false);

    const toggleDropdown = () => setDropdownOpen(prev => !prev);

    return (
        <PageContainer>
            <Sidebar>
                <ProfileSection>
                    <ProfileImage 
                        src="https://via.placeholder.com/50" /* Replace with your profile image URL */
                        alt="Profile"
                    />
                    <ProfileDetails>
                        <Name>John Doe</Name> {/* Replace with dynamic name */}
                        <Email>john.doe@example.com</Email> {/* Replace with dynamic email */}
                    </ProfileDetails>
                </ProfileSection>

                <Section>
                    <Title>Previous Reports</Title>
                    {/* Add previous reports elements here */}
                </Section>
                <Section>
                    <PreviousSubmissionsButton onClick={toggleDropdown}>
                        Previous Submissions
                    </PreviousSubmissionsButton>
                    <Dropdown isOpen={isDropdownOpen}>
                        {submissions.map((submission, index) => (
                            <DropdownItem key={index}>
                                <strong>{submission.title}</strong>
                                <p>{submission.details}</p>
                            </DropdownItem>
                        ))}
                    </Dropdown>
                </Section>
                <Section>
                    <Title>Submit GitHub Repository</Title>
                    <Input type="text" placeholder="Enter GitHub URL" />
                    <Button>Submit</Button>
                </Section>
            </Sidebar>
            <Content>
                <Section>
                    <Title>Report Resolve</Title>
                    {/* Add report resolution details here */}
                </Section>
                <Section>
                    <Title>Current Projects</Title>
                    {/* Add current projects details here */}
                </Section>
                <Section>
                    <Title>Upload APK File</Title>
                    <Input type="file" />
                    <Button>Upload & Analyze</Button>
                </Section>
                <Section>
                    <Title>Vulnerabilities Analysis</Title>
                    <ul>
                        <li>Static Analysis</li>
                        <li>Configuration Analysis</li>
                        <li>External Dependencies</li>
                    </ul>
                </Section>
            </Content>
        </PageContainer>
    );
}

export default UploadPage;
